/**
 * Macro for checking the consistency of AUTOSAR Spec versions of the
 * different files of the module
 */
/* Deviation from MISRA-C:2004 rule 19.7, MISRA-C:2012 Dir-4.9.
   Justification: In case of using in Preprocessing, function-like macro is used.
   It improves readability. */
/* PRQA S 3453 10 */
#define FLS_AR_VERSION_CHECK(                                                       \
    file_ar_release_major_version,                                                  \
    file_ar_release_minor_version,                                                  \
    file_ar_release_revision_version                                                \
    )                                                                               \
    (                                                                               \
        ((FLS_AR_RELEASE_MAJOR_VERSION) == (file_ar_release_major_version)) &&      \
        ((FLS_AR_RELEASE_MINOR_VERSION) == (file_ar_release_minor_version)) &&      \
        ((FLS_AR_RELEASE_REVISION_VERSION) == (file_ar_release_revision_version))   \
    )

/**
 * Macro for checking the consistency of the software versions of the
 * different files of the Fls module
 */
/* Deviation from MISRA-C:2004 rule 19.7, MISRA-C:2012 Dir-4.9.
   Justification: In case of using in Preprocessing, function-like macro is used.
   It improves readability. */
/* PRQA S 3453 10 */
#define FLS_SW_VERSION_CHECK(                                  \
    file_sw_major_version,                                     \
    file_sw_minor_version,                                     \
    file_sw_patch_version                                      \
    )                                                          \
    (                                                          \
        ((FLS_SW_MAJOR_VERSION) == (file_sw_major_version)) && \
        ((FLS_SW_MINOR_VERSION) == (file_sw_minor_version)) && \
        ((FLS_SW_PATCH_VERSION) >= (file_sw_patch_version))    \
    )

/**
 * Macro for checking the consistency of Module ID and Vendor ID
 */
/* Deviation from MISRA-C:2004 rule 19.7, MISRA-C:2012 Dir-4.9.
   Justification: In case of using in Preprocessing, function-like macro is used.
   It improves readability. */
/* PRQA S 3453 7 */
#define FLS_EXTRA_CHECK(                       \
    module_id,vendor_id                        \
    )                                          \
    (                                          \
        ((FLS_MODULE_ID) == (module_id)) &&    \
        ((FLS_VENDOR_ID) == (vendor_id))       \
    )

